import React from 'react'
import { BrowserRouter as Router, Route } from "react-router-dom";

const Logout = (props) => {
    props.handleLoggedIn();
    return (
        <Router>
            <Route path="/logout" render={() => (<Redirect to="/sign-up"/>)}></Route>
        </Router>

    );
}

export default Logout;
